import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { useState } from 'react';

function Candidates() {
  const [candidates, setCandidates] = useState([]);

  useEffect(() => {
    axios
      .get('http://localhost:8081/candidates')
      .then(response => setCandidates(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div className="container mx-auto mt-24">
      <h2 className="text-2xl font-semibold text-gray-800 mb-6 text-center">
        Candidates Registered
      </h2>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white border border-gray-300 rounded-lg shadow-lg">
          <thead className="bg-gray-800 text-white">
            <tr>
              <th className="py-3 px-6 text-left">Id</th>
              <th className="py-3 px-6 text-left">Name</th>
              <th className="py-3 px-6 text-left">Area of Expertise</th>
              <th className="py-3 px-6 text-left">Education</th>
              <th className="py-3 px-6 text-left">Experience</th>
              <th className="py-3 px-6 text-left"></th>
            </tr>
          </thead>
          <tbody>
            {candidates.map(candidate => (
              <tr key={candidate.id}>
                <td className="py-3 px-6 text-left">{candidate.id}</td>
                <td className="py-3 px-6 text-left">{candidate.name}</td>
                <td className="py-3 px-6 text-left">{candidate.areaOfExpertise}</td>
                <td className="py-3 px-6 text-left">{candidate.education}</td>
                <td className="py-3 px-6 text-left">{candidate.experience}</td>
                <td className="py-3 px-6 text-left">
                  {/* Add action buttons or links here */}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Candidates;
